import React, { Component } from "react";
import { Collapse, Navbar, NavbarBrand, NavbarToggler, NavItem, NavLink, Nav } from "reactstrap";

class R049_ReactstrapNavbar extends Component{
    constructor(props) {
        super(props);
        this.state = {
            collapsed:false
        }
    }

    toggle = () => {
        this.setState({collapsed: !this.state.collapsed})
    }

    render() {
        return(
            <>
                <Navbar color="fades" light>
                    <NavbarBrand href="/" className="mr-auto">Navbar</NavbarBrand>
                    <NavbarToggler onClick={this.toggle} className="mr=2"/>

                    <Collapse isOpen={this.state.collapsed} navbar>
                        <Nav navbar>
                            <NavItem>
                                <NavLink href="#">react</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="#">react2</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>
                </Navbar>
            </>
        )
    }
}

export default R049_ReactstrapNavbar;
